import React, {Component} from 'react';
import axios from 'axios';

class Home extends Component{
	constructor (props) {
		super(props);
		this.state = {
			users: [],
		};
	}

	componentDidMount() {
		axios.get('http://127.0.0.1:1337/user')
		.then(results => {
			console.log(results.data);
			return results;

		}).then(results => {
			let users = results.data.map((user) => {
				return(
					<div>
						<h3> {user.fullName}</h3>
						{user.emailAddress}<br/>
						id: {user.id} <br/>
					</div>
				)
			})
		this.setState({users:users});
		console.log("this.state ", this.state.users);
	})


}

render(){
	return (
		<div>
		<h2>All Users</h2>
		{this.state.users}
		</div>
		)

}

}

export default Home;
